import  React, { Component } from 'react'
import './App.css'

class App extends Component {
  constructor() {
    super()
    this.handleClick= this.handleClick.bind(this)
  }
  render () {
    return (
      <div className ='button_style'>
      <button className = 'button' onClick={this.handleClick}> Click Here </button>
      </div>
    )
  }
}
export default App
